import React, { Component } from 'react';
import logo from './my_logo.PNG';

class SiteHeader extends Component {
  render() {
    return (
        <div class='site_header'>
            <img src={logo} alt='My LOGO'/>
            <h1>Web crawler</h1>
        </div>
    );
  }
}

export default SiteHeader;
